// Scroll functions for buttons
function scrollLeft(carouselId) {
    const carousel = document.getElementById(carouselId);
    const scrollAmount = 200; // Amount to scroll left or right
    // Calculate new scroll position
    const newScrollPosition = carousel.scrollLeft - scrollAmount;
    // Scroll to new position, ensuring it does not go below 0
    carousel.scrollTo({
        left: Math.max(newScrollPosition, 0),
        behavior: 'smooth'
    });
}

function scrollRight(carouselId) {
    const carousel = document.getElementById(carouselId);
    const scrollAmount = 200; // Amount to scroll left or right
    // Calculate new scroll position
    const newScrollPosition = carousel.scrollLeft + scrollAmount;
    // Scroll to new position, ensuring it does not exceed scrollWidth - clientWidth
    carousel.scrollTo({
        left: Math.min(newScrollPosition, carousel.scrollWidth - carousel.clientWidth),
        behavior: 'smooth'
    });
}

// Display content for each carousel
displayContent(trendingMovies, 'trending-carousel');
displayContent(popularTVShows, 'popular-carousel');
displayContent(topRatedContent, 'top-rated-carousel');